import open3d
import open3d as o3d
import multiprocessing as mp
import time
import numpy as np
import transforms3d.euler as txe

from multiprocessing import Process, Queue
from queue import Empty as queue_empty

class Viewer(object):
  def __init__(self):
    self.q = mp.Queue()

  def worker(self, q):
    for _ in range(5):
      time.sleep(1)
      T = np.eye(4)
      T[:3, :3] = txe.euler2mat(np.deg2rad(20), 0, 0)
      q.put(T)
      print('put')
    q.put(None)  # poison pill

  def run(self):
    global verts, faces
    verts = np.array(verts)
    faces = np.array(faces)
    print(verts.shape) # (1556, 3)
    print(faces.shape) # (3076, 3)

    mesh = o3d.geometry.TriangleMesh()
    mesh.triangles = o3d.utility.Vector3iVector(faces)
    mesh.vertices = o3d.utility.Vector3dVector(verts)

    mesh.compute_vertex_normals()

    vis = open3d.visualization.Visualizer()
    vis.create_window('cloud', width=640, height=480)
    vis.add_geometry(mesh)


    mesh.paint_uniform_color([228 / 255, 178 / 255, 148 / 255])
    mesh.compute_triangle_normals()
    mesh.compute_vertex_normals()



    p = mp.Process(target=self.worker, args=(self.q, ))
    p.start()

    keep_running = True
    while keep_running:
      try:
        T = self.q.get(block=False)
        if T is not None:
          print('got T')
          mesh.transform(T)
          mesh.vertices = o3d.utility.Vector3dVector(verts*1.2)
        else:
          print('got poison. dying')
          keep_running = False
        vis.update_geometry(mesh)
      except queue_empty:
        pass
      vis.update_renderer()
      keep_running = keep_running and vis.poll_events()
    vis.destroy_window()
    p.join()

if __name__ == '__main__':
  v = Viewer()
  v.run()